INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 2.46, 0, 3, 1, 12300150, 5, 3001, "vo_minigame_1012_result_1082", 1, 9, 2, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 2.94, 0, 3, 1, 12300151, 5, 3001, "vo_minigame_1012_result_1083", 1, 9, 2, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 4.19, 0, 7, 1, 12300152, 5, 3001, "vo_minigame_1012_result_1084", 1, 9, 3, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 0.0, 0, 1, 1, 12300153, 5, 3001, "vo_minigame_1012_result_1085", 1, 9, 3, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 2.63, 0, 3, 1, 12300154, 5, 3001, "vo_minigame_1012_result_1086", 1, 9, 3, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 5.53, 0, 3, 1, 12300155, 1, 3001, "vo_minigame_1012_result_1087", 1, 4, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 0.01, 9, 3, 1, 12300156, 1, 3001, "vo_minigame_1012_result_1088", 3, 4, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 4.15, 3, 3, 1, 12300157, 1, 3001, "vo_minigame_1012_result_1089", 1, 4, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 0.01, 9, 9, 1, 12300158, 1, 3001, "vo_minigame_1012_result_1090", 9, 4, 2, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 5.37, 0, 3, 1, 12300159, 1, 3001, "vo_minigame_1012_result_1091", 1, 4, 2, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！");
