INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 0.0, 0, 3, 1, 12300161, 1, 3001, "vo_minigame_1012_result_1093", 3, 4, 3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？");
INSERT INTO `v1_07523d8c56472ced2cec97ea4b2e36b45de692cacb785b5a685bc33e07f454ac` VALUES (2, 2.91, 3, 3, 1, 12300162, 1, 3001, "vo_minigame_1012_result_1094", 9, 4, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！");
